import React from 'react';
// import stylings
import './App.css';
// import components
import Header from './components/Header';
import Social from './components/Social';
// import data
import SocialData from './JSONs/Mocial.json';

function App() {
  return (
    <div className="App">
      <Header 
        title={`Fronrich Puno`}
        subtitle={`Class of 2021`}
      />
      <Social 
        social={SocialData}
      />
    </div>
  );
}

export default App;
